interface ButtonProps {
    children: React.ReactNode;
    onClick?: () => void;
}

const OutlineButton: React.FC<ButtonProps> = ({children, onClick}) => {
    return <>
        <button onClick={onClick} className='px-6 py-1.5 border rounded-lg border-orange-500 text-orange-500 bg-white font-semibold flex'>
            { children }
        </button>
    </>
}

export default OutlineButton;
